contracts/Auction.sol.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract Auction {
    address public NFTAddress;
    uint256 public auctionCounter = 0;
    address owner;
    uint256 public minimumAuctionFee;
    struct AuctionData {
        uint256 auctionId;
        address payable seller;
        uint256 highestBid;
        address highestBidder;
        uint256 auctionStartTime;
        uint256 auctionCommitEndTime;
        uint256 auctionRevealEndTime;
        uint256 miniumBidAmount;
        bool finalized;
        uint256 tokenId;
    }
    struct Bid {
        bytes32 commitHash;
        uint256 bidAmount;
        bool revealed;
    }
    mapping(uint256 => AuctionData) public auctions;
    mapping(uint256 => mapping(address => Bid)) public auctionsBid;
    constructor(address _NFTAddress, uint256 _minimumAuctionFee) {
        // Initialize the contract with the address of the NFT contract
        NFTAddress = _NFTAddress;
        minimumAuctionFee = _minimumAuctionFee;
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this");
        _;
    }

    modifier onlySellerOrOwner(uint256 auctionId) {
        require(msg.sender == auctions[auctionId].seller || msg.sender == owner, "Only seller and owner can call this");
        _;
    }

    modifier withinCommitPhase(uint256 auctionId) {
        require(block.timestamp < auctions[auctionId].auctionCommitEndTime, "Commit phase has ended");
        _;
    }

    modifier withinRevealPhase(uint256 auctionId) {
        require(block.timestamp >= auctions[auctionId].auctionCommitEndTime && block.timestamp < auctions[auctionId].auctionRevealEndTime, "Not within reveal phase");
        _;
    }

    modifier afterRevealPhase(uint256 auctionId) {
        require(block.timestamp >= auctions[auctionId].auctionRevealEndTime, "Reveal phase still ongoing");
        _;
    }

    modifier _minimumAuctionFee() {
        require(msg.value >=  minimumAuctionFee * 1e18, "Minimum auction fee is needed");
        _;
    }

    // Create a new auction
    function createAuction(uint256 _tokenId, uint256 _miniumBidAmount, uint256 _auctionCommitEndTime, uint256 _auctionRevealEndTime) public payable _minimumAuctionFee {
        IERC721(NFTAddress).transferFrom(msg.sender, address(this), _tokenId);
        auctionCounter++;
        auctions[auctionCounter] = AuctionData(auctionCounter, payable(msg.sender), 0, address(0), block.timestamp, _auctionCommitEndTime, _auctionRevealEndTime, _miniumBidAmount, false, _tokenId);
    }

    // Commit phase: users submit their hashed bid
    function commitBid(uint256 auctionId, bytes32 _commitHash) public payable withinCommitPhase(auctionId) {
        require(auctionsBid[auctionId][msg.sender].commitHash == 0, "Already committed");
        require(msg.value > 0, "Must send ETH with your bid");
        require(msg.value > auctions[auctionId].miniumBidAmount, "Bid must be higher than the current bid");
        
        // Record the commit hash and bid value (value is held in the contract)
        auctionsBid[auctionId][msg.sender] = Bid(_commitHash, msg.value, false);
    }

    // Reveal phase: users reveal their bid by submitting the original bid and nonce
    function revealBid(uint256 auctionId, uint256 _bidAmount, uint256 _nonce) public withinRevealPhase(auctionId) {
        Bid storage bid = auctionsBid[auctionId][msg.sender];
        require(bid.commitHash != 0, "No bid to reveal");
        require(!bid.revealed, "Already revealed");
        
        // Recreate the hash from the provided bid amount and nonce
        bytes32 calculatedHash = keccak256(abi.encodePacked(_bidAmount, _nonce));

        // Verify the hash matches the one submitted during the commit phase
        require(calculatedHash == bid.commitHash, "Hash mismatch. Incorrect bid or nonce");

        bid.revealed = true;
        bid.bidAmount = _bidAmount;

        // Check if it's the highest bid
        if (_bidAmount > auctions[auctionId].highestBid) {
            auctions[auctionId].highestBid = _bidAmount;
            auctions[auctionId].highestBidder = msg.sender;
        }
    }

    // End auction and transfer funds to the winner
    // Owner can also finalize the auction if no bids were placed or if the seller is inactive
    function finalizeAuction(uint256 auctionId) public onlySellerOrOwner(auctionId) afterRevealPhase(auctionId) {
        require(auctions[auctionId].finalized == false, "Auction already finalized");
        if (auctions[auctionId].highestBidder != address(0)) { // If there are bids
            // Mark the auction as finalized
            auctions[auctionId].finalized = true;
            // Transfer the highest bid amount to the owner (auctioneer)
            payable(owner).transfer(auctions[auctionId].highestBid);

            // Transfer the NFT to the highest bidder
            IERC721(NFTAddress).transferFrom(address(this), auctions[auctionId].highestBidder, auctions[auctionId].tokenId);
        } else { // If no bids were placed
            auctions[auctionId].finalized = true;
            // Transfer the NFT back to the seller
            IERC721(NFTAddress).transferFrom(address(this), auctions[auctionId].seller, auctions[auctionId].tokenId);
        }
    }

    // Withdraw refunds for non-winning bids
    function withdrawRefund(uint256 auctionId) public afterRevealPhase(auctionId) {
        require(auctions[auctionId].finalized == true, "Auction have yet finalized");
        Bid storage bid = auctionsBid[auctionId][msg.sender];
        require(bid.revealed, "Bid not revealed");
        require(msg.sender != auctions[auctionId].highestBidder, "Winner cannot withdraw");

        // Refund the user's bid amount
        uint256 refundAmount = bid.bidAmount;
        bid.bidAmount = 0; // Prevent re-entrancy
        payable(msg.sender).transfer(refundAmount);
    }

    //Getters fuction
    function getAuction(uint256 auctionId) public view returns (AuctionData memory) {
        return auctions[auctionId];
    }

    //Owner functions

    // Owner can withdraw the balance of the contract
    function ownerWithdraw() public onlyOwner {
        payable(owner).transfer(address(this).balance);
    }

    // Owner can change the minimum auction fee
    function setMinimumAuctionFee(uint256 _minimumAuctionFee) public onlyOwner {
        minimumAuctionFee = _minimumAuctionFee;
    }
}

contracts/CoffeeMarketplace.sol.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "./Product.sol";

contract CoffeeMarketplace is ERC721URIStorage, Ownable, IERC721Receiver, Product {
    uint256 public tokenCounter = 0;   // Counter for NFT IDs

    // Events
    event NFTMinted(uint256 indexed tokenId, address indexed owner, string tokenURI);
    event ListingAdded(uint256 productId, address indexed roaster, string name, uint256 price, uint256 quantity);

    // Constructor for initializing ERC721 with a name and symbol and passing msg.sender to Ownable
    constructor() ERC721("CoffeeNFT", "COFFEE") Ownable(msg.sender) {}

    // Add a new product and mint NFTs for the product
    function addRoasterListing(
        string memory _name,
        string memory _description,
        string memory _ipfsHash,
        uint256 _price,
        uint256 _quantity
    ) public {
        require(_price > 0, "Price must be greater than zero.");
        require(_quantity > 0, "Quantity must be greater than zero.");

        uint256[] memory nftIds = new uint256[](_quantity);

        // Mint NFTs for each unit of the product and store their IDs
        for (uint256 i = 0; i < _quantity; i++) {
            tokenCounter++;
            uint256 tokenId = tokenCounter;
            _safeMint(address(this), tokenId); // Assign NFT to the smart contract itself
            _setTokenURI(tokenId, _ipfsHash); // IPFS hash as the token URI (metadata link)
            nftIds[i] = tokenId;

            emit NFTMinted(tokenId, address(this), _ipfsHash);
        }

        // Add product to the mapping via the inherited Product contract
        addProduct(msg.sender, _name, _description, _ipfsHash, _price, _quantity, nftIds);
        emit ListingAdded(productCounter, msg.sender, _name, _price, _quantity);
    }

    // Implement the onERC721Received function to accept NFTs
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}

contracts/Product.sol.content:
pragma solidity ^0.8.0;

contract Product {
    // Counter for product IDs
    uint256 public productCounter = 0;

    // Struct to store product details
    struct ProductDetails {
        uint256 productId;
        address roaster;
        string name;
        string description;
        string ipfsHash;  // IPFS hash for product image/metadata
        uint256 price;     // Price in Wei (Ether)
        uint256 quantity;
        uint256[] nftIds;  // Array of NFT IDs for this product
        bool available;
    }

    // Mapping to store products
    mapping(uint256 => ProductDetails) public products;

    // Events
    event ProductAdded(uint256 productId, address indexed roaster, string name, uint256 price, uint256 quantity);

    // Function to add a new product
    function addProduct(
        address _roaster,
        string memory _name,
        string memory _description,
        string memory _ipfsHash,
        uint256 _price,
        uint256 _quantity,
        uint256[] memory _nftIds
    ) internal returns (uint256) {
        require(_price > 0, "Price must be greater than zero.");
        require(_quantity > 0, "Quantity must be greater than zero.");

        productCounter++;

        products[productCounter] = ProductDetails(
            productCounter,
            _roaster,
            _name,
            _description,
            _ipfsHash,
            _price,
            _quantity,
            _nftIds,
            true
        );

        emit ProductAdded(productCounter, _roaster, _name, _price, _quantity);
        return productCounter;
    }

    // Function to get product details
    function getListing(uint256 _productId) public view returns (
        string memory name,
        string memory description,
        string memory ipfsHash,
        uint256 price,
        uint256 quantity,
        uint256[] memory nftIds,
        bool available
    ) {
        ProductDetails memory product = products[_productId];
        require(product.productId > 0, "Product does not exist.");

        return (
            product.name,
            product.description,
            product.ipfsHash,
            product.price,
            product.quantity,
            product.nftIds,
            product.available
        );
    }
}

contracts/Voting.sol.content:
pragma solidity ^0.8.0;

contract Voting {
    uint256 public candidateCounter = 0;
    struct CoffeeVoteCandidate {
        uint256 candidateId;
        string coffeeName;
        string imageUrl;
        string description;
        string coffeeOrigin;
        string beanType;
        string roastLevel;
        uint256 voteCount;
    }

    CoffeeVoteCandidate[] public coffee_vote_candidates;
    address owner;
    mapping(address => bool) public customers;
    uint256 public votingStartTime;
    uint256 public votingEndTime;
    event CoffeeCandidateAdded(string coffeeName, string imageUrl, string description, string coffeeOrigin, string beanType, string roastLevel);
    event CoffeeVoted(uint256 candidateId);

constructor(string[] memory _coffeeCandidateNames,
            string[] memory _coffeeImageUrls,
            string[] memory _coffeeDescriptions,
            string[] memory _coffeeOrigins,
            string[] memory _beanTypes,
            string[] memory _roastLevels,
            uint256 _durationInMinutes) {
    for (uint256 i = 0; i < _coffeeCandidateNames.length; i++) {
        coffee_vote_candidates.push(CoffeeVoteCandidate({
                        candidateId: candidateCounter++,
                        coffeeName: _coffeeCandidateNames[i],
                        imageUrl: _coffeeImageUrls[i],
                        description: _coffeeDescriptions[i],
                        coffeeOrigin: _coffeeOrigins[i],
                        beanType: _beanTypes[i],
                        roastLevel: _roastLevels[i],
                        voteCount: 0
        }));
    }
    owner = msg.sender;
    votingStartTime = block.timestamp;
    votingEndTime = block.timestamp + (_durationInMinutes * 1 minutes);
}

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    // This function is used to add a new coffee candidate to the voting list
    function addCoffeeCandidate(string memory _coffeeName,
                                string memory _imageUrl,
                                string memory _description,
                                string memory _coffeeOrigin,
                                string memory _beanType,
                                string memory _roastLevel) public onlyOwner {
        coffee_vote_candidates.push(CoffeeVoteCandidate({
                candidateId: candidateCounter++,
                coffeeName: _coffeeName,
                imageUrl: _imageUrl,
                description: _description,
                coffeeOrigin: _coffeeOrigin,
                beanType: _beanType,
                roastLevel: _roastLevel,
                voteCount: 0
        }));
        emit CoffeeCandidateAdded(_coffeeName, _imageUrl, _description, _coffeeOrigin, _beanType, _roastLevel);
    }

    // This function is used to vote for a coffee candidate
    function vote(uint256 _coffeeCandidateIndex) public {
        require(!customers[msg.sender], "You have already voted for a coffee.");
        require(_coffeeCandidateIndex < coffee_vote_candidates.length, "Invalid coffee candidate, please select a valid coffee candidate.");
        require(isOpenToVote(), "Voting is closed.");
        coffee_vote_candidates[_coffeeCandidateIndex].voteCount++;
        customers[msg.sender] = true;
        emit CoffeeVoted(_coffeeCandidateIndex);
    }

    // This function is used to get all the coffee candidates (used to get all their votes)
    function getAllVotesOfCoffeeCandiates() public view returns (CoffeeVoteCandidate[] memory){
        return coffee_vote_candidates;
    }

    // This function is to get the specific coffee candidate details
    function getCoffeeCandidate(uint256 _index) public view returns (CoffeeVoteCandidate memory) {
        require(_index < coffee_vote_candidates.length, "Invalid coffee candidate, please select a valid coffee candidate.");
        return coffee_vote_candidates[_index];
    }

    // This function is used to see if voting is still open
    function isOpenToVote() public view returns (bool) {
        return (block.timestamp >= votingStartTime && block.timestamp < votingEndTime);
    }

    // This function is used to get the remaining time for voting
    function getRemainingTimeLeftToVote() public view returns (uint256) {
        require(block.timestamp >= votingStartTime, "Voting has not started yet.");
        if (block.timestamp >= votingEndTime) {
            return 0;
    }
        return votingEndTime - block.timestamp;
    }
}

